import React from 'react';
import ListItem from './list_items';
import './navbar_item.css';



class NavItem extends React.Component{
  render(){
    return(
      <div>
        {ListItem.map((item,index) => {
          return(
            <li key={index}>
                <a className={item.cName} href={item.url}>
                {item.name}
                </a>
            </li>
          )
        })}
        </div>
    )
  }
}

export default NavItem
